    the beginning date of the first report that was submitted electronically using
    this software, there is a discrepancy with the amount owed. To remedy this situation,
    the discrepancy amount of 3828.88 was taken form the original loan amount so that
    the balance owed, which is 5037.93, would be reported, instead of 8868.81 (which
    was the amount that FECfile4 was showing as owed to First Commercial Bank).   According
    to records and tabulations kept on file at the Committee office, in addition to
    the amount given by the lending institution, First Commercial Bank, the amount
    of 5037.93 is correct."
